import React from 'react';
import './App.css';
import './Awards.css';

function Awards() {
    return (
        <div>
            <div className="container-1">
                <div className="box-1" />
                <div className="box-2" />
                <div className="box-3" />
                <div className="box-4" />
                <div className="box-5" />
            </div>
            <div className="container-2">
                <div className="awardText">plant a seed</div>
                <div className="awardText">hold a 2 day streak</div>
                <div className="awardText">hold a 5 day streak</div>
                <div className="awardText">grow a tree</div>
                <div className="awardText">join growers club</div>
            </div>
        </div>
    )
}
export default Awards;
